    false,nt"url": null,nt"notes": "The purpose of the Fort Niobrara National
    Wildlife Refuge River Recreation Management Plan is to provide guidance and direction
    for management of recreational floating on the nine miles of Niobrara River that
    flow through the Fort Niobrara National Wildlife Refuge (NWR). This plan is an updated
    and revised version of the Draft Fort Niobrara NWR River Recreation Management Plan
    and Environmental Assessment completed in August 2004. It has been written to ensure
    that river floating through the Refuge remains a compatible, wildlife-dependent
    pubic use activity. This plan also addresses the administration of commercial river
    outfitters who provide services to Refuge visitors.  This plan, in its present form,
    contains goals, objectives, and implementation strategies found by the Service to
    best support the purposes of Fort Niobrara NWR and the mission of the National Wildlife
    Refuge System.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
